REPLACE INTO `cvx_codes` VALUES (167,'998','no vaccine administered','Full Vaccine Name','Code 998 was added for use in VXU HL7 messages where the OBX segment is nested with the RXA segment, but the message does not contain information about a vaccine administration. An example of this use is to report the vaccines due next for a patient when no vaccine administration is being reported.','Inactive','2010-05-28 00:00:00'),(168,'99','RESERVED - do not use','RESERVED - do not use','Code 99 will not be used in this table to avoid confusion with code 999.','Inactive','2010-05-28 00:00:00'),(169,'999','unknown','unknown vaccine or immune globulin','This CVX code has little utility and should rarely be used.','Inactive','2010-05-28 00:00:00'),(170,'143','Adenovirus types 4 and 7','Adenovirus, type 4 and type 7, live, oral','This vaccine is administered as 2 tablets.','Active','2011-03-20 00:00:00'),(171,'54','adenovirus, type 4','adenovirus vaccine, type 4, live, oral','','Inactive','2010-05-28 00:00:00'),(172,'55','adenovirus, type 7','adenovirus vaccine, type 7, live, oral','','Inactive','2010-05-28 00:00:00'),(173,'82','adenovirus, unspecified formulation','adenovirus vaccine, unspecified formulation','This CVX code allows reporting of a vaccination when formulation is unknown (for example, when recording a adenovirus vaccination when noted on a vaccination card)','Inactive','2010-09-30 00:00:00'),(174,'24','anthrax','anthrax vaccine','','Active','2010-05-28 00:00:00'),(175,'801','AS03 Adjuvant','AS03 Adjuvant','This is the adjuvant that is packaged with H5N1 vaccine, adjuvanted','Active','2014-02-07 00:00:00'),(176,'19','BCG','Bacillus Calmette-Guerin vaccine','','Active','2010-05-28 00:00:00'),(177,'27','botulinum antitoxin','botulinum antitoxin','','Active','2010-05-28 00:00:00'),(178,'26','cholera','cholera vaccine','','Inactive','2010-05-28 00:00:00'),(179,'29','CMVIG','cytomegalovirus immune globulin, intravenous','','Active','2010-05-28 00:00:00'),(180,'56','dengue fever','dengue fever vaccine','','Never Active','2010-05-28 00:00:00'),(181,'12','diphtheria antitoxin','diphtheria antitoxin','','Active','2010-05-28 00:00:00'),(182,'28','DT (pediatric)','diphtheria and tetanus toxoids, adsorbed for pediatric use','','Active','2010-05-28 00:00:00'),(183,'20','DTaP','diphtheria, tetanus toxoids and acellular pertussis vaccine','','Active','2010-05-28 00:00:00'),(184,'106','DTaP, 5 pertussis antigens','diphtheria, tetanus toxoids and acellular pertussis vaccine, 5 pertussis antigens','','Active','2010-05-28 00:00:00'),(185,'107','DTaP, unspecified formulation','diphtheria, tetanus toxoids and acellular pertussis vaccine, unspecified formulation','This CVX code allows reporting of a vaccination when formulation is unknown (for example, when recording a DTaP vaccination when noted on a vaccination card)','Inactive','2010-09-30 00:00:00'),(186,'146','DTaP,IPV,Hib,HepB','Diphtheria and Tetanus Toxoids and Acellular Pertussis Adsorbed, Inactivated Poliovirus, Haemophilus b Conjugate (Meningococcal Outer Membrane Protein Complex), and Hepatitis B (Recombinant) Vaccine.','Note that this vaccine is different from CVX 132.','Pending','2011-08-31 00:00:00'),(187,'102','DTaP/DTP-Hib-Hep B','DTP- Haemophilus influenzae type b conjugate and hepatitis b vaccine','This non-US vaccine contained DTP prior to 2007 and now contains DTaP','Inactive','2014-05-30 00:00:00'),(188,'110','DTaP-Hep B-IPV','DTaP-hepatitis B and poliovirus vaccine','','Active','2010-05-28 00:00:00'),(189,'50','DTaP-Hib','DTaP-Haemophilus influenzae type b conjugate vaccine','','Active','2010-05-28 00:00:00'),(190,'120','DTaP-Hib-IPV','diphtheria, tetanus toxoids and acellular pertussis vaccine, Haemophilus influenzae type b conjugate, and poliovirus vaccine, inactivated (DTaP-Hib-IPV)','','Active','2010-05-28 00:00:00'),(191,'130','DTaP-IPV','Diphtheria, tetanus toxoids and acellular pertussis vaccine, and poliovirus vaccine, inactivated','','Active','2010-05-28 00:00:00'),(192,'132','DTaP-IPV-HIB-HEP B, historical','Historical record of vaccine containing\n    * diphtheria, tetanus toxoids and acellular pertussis,\n    * poliovirus, inactivated,\n    * Haemophilus influenzae type b conjugate,\n    * Hepatitis B','This is not the same as CVX 146, Hexavalent vaccine.','Inactive','2015-05-18 00:00:00'),(193,'01','DTP','diphtheria, tetanus toxoids and pertussis vaccine','','Inactive','2010-05-28 00:00:00'),(194,'22','DTP-Hib','DTP-Haemophilus influenzae type b conjugate vaccine','','Inactive','2010-05-28 00:00:00'),(195,'57','hantavirus','hantavirus vaccine','','Never Active','2010-05-28 00:00:00'),(196,'30','HBIG','hepatitis B immune globulin','','Active','2010-05-28 00:00:00'),(197,'52','Hep A, adult','hepatitis A vaccine, adult dosage','','Active','2010-05-28 00:00:00'),(198,'154','Hep A, IG','Hepatitis A immune globulin','Do not use this code. This product may be used for Hep A and other viral infections. The correct vaccine / CVX is 86 (IG).','Never Active','2013-04-01 00:00:00'),(199,'83','Hep A, ped/adol, 2 dose','hepatitis A vaccine, pediatric/adolescent dosage, 2 dose schedule','','Active','2010-05-28 00:00:00'),(200,'84','Hep A, ped/adol, 3 dose','hepatitis A vaccine, pediatric/adolescent dosage, 3 dose schedule','This vaccine formulation is inactive and should not be used, except to record historic vaccinations with this formulation.','Inactive','2010-05-28 00:00:00'),(201,'31','Hep A, pediatric, unspecified formulation','hepatitis A vaccine, pediatric dosage, unspecified formulation','Do NOT use this code.  If formulation is unknown, use CVX 85.  There is only one formulation of Hep A, peds.','Inactive','2010-09-30 00:00:00'),(202,'85','Hep A, unspecified formulation','hepatitis A vaccine, unspecified formulation','This CVX code allows reporting of a vaccination when formulation is unknown (for example, when recording a HepA vaccination when noted on a vaccination card)','Inactive','2010-09-30 00:00:00'),(203,'104','Hep A-Hep B','hepatitis A and hepatitis B vaccine','','Active','2010-05-28 00:00:00'),(204,'08','Hep B, adolescent or pediatric','hepatitis B vaccine, pediatric or pediatric/adolescent dosage','This code applies to any standard pediatric formulation of Hepatitis B vaccine. It should not be used for the 2-dose hepatitis B schedule for adolescents (11-15 year olds). It requires Merck\'s Recombivax HB® adult formulation. Use code 43 for that vaccine.','Active','2010-05-28 00:00:00'),(205,'42','Hep B, adolescent/high risk infant','hepatitis B vaccine, adolescent/high risk infant dosage','As of August 27, 1998, Merck ceased distribution of their adolescent/high risk infant hepatitis B vaccine dosage. Code 42 should only be used to record historical records. For current administration of hepatitis B vaccine, pediatric/adolescent dosage, use code 08.','Inactive','2010-05-28 00:00:00'),(206,'43','Hep B, adult','hepatitis B vaccine, adult dosage','As of September 1999, a 2-dose hepatitis B schedule for adolescents (11-15 year olds) was FDA approved for Merck\'s Recombivax HB® adult formulation. Use code 43 for the 2-dose. This code should be used for any use of standard adult formulation of hepatitis B vaccine.','Active','2010-05-28 00:00:00'),(207,'44','Hep B, dialysis','hepatitis B vaccine, dialysis patient dosage','','Active','2010-05-28 00:00:00'),(208,'45','Hep B, unspecified formulation','hepatitis B vaccine, unspecified formulation','This CVX code allows reporting of a vaccination when formulation is unknown (for example, when recording a HepB vaccination when noted on a vaccination card)','Inactive','2010-09-30 00:00:00'),(209,'58','Hep C','hepatitis C vaccine','','Never Active','2010-05-28 00:00:00'),(210,'59','Hep E','hepatitis E vaccine','','Never Active','2010-05-28 00:00:00'),(211,'60','herpes simplex 2','herpes simplex virus, type 2 vaccine','','Never Active','2010-05-28 00:00:00'),(212,'47','Hib (HbOC)','Haemophilus influenzae type b vaccine, HbOC conjugate','','Inacti